(1, 'Tentang Kami', 'Komitmen Bersama dalam Pencegahan dan percepatan penurunan Stunting dan penguatan keluarga di Kota Tomohon', 'Website ini merupakan platform informasi dan pelaporan berbasis data untuk mendukung program nasional dan Kota Tomohon dalam pengcegahan dan percepatan penurunan stunting. Dengan pendekatan berbasis keluarga dan kolaborasi lintas sektor, kami berupaya memberikan layanan yang holistik untuk ibu hamil, menyusui, dan balita.', 'Data yang tersedia mencakup pemantauan pertumbuhan anak, edukasi ibu, hingga peta geospasial wilayah rentan stunting. Tujuan kami adalah memastikan setiap anak Indonesia tumbuh sehat, cerdas, dan berkualitas sebagai investasi masa depan bangsa.', 'timbol', 'https://link', 'tentang_kami/gsC1yomIB1nzVTnzwQI9bigFFEjYCOBmLguhdMjw.jpg', 'tentang_kami/I7mgtgfHLnM3UTnj0uGxbUN0HdCNItmFkf6DuHdc.jpg', '2025-09-27 21:18:49', '2025-09-01 17:19:00', '2025-09-27 21:18:49');
